    number: '6'
    value: "January 20, 2009    Rosa G Lewis  Reports Analysis Division  Federal Election
      Commission  999 E 9th Street\t  Washington, DC  20463    Dear Rosa,    This
      letter is in response to your January 9, 2009, letter of inquiry regarding the
      October Quarterly Report (7/1/08 - 9/30/08) for Heartland Values PAC (C00409003).
      \ We have reviewed our records supporting the above-referenced report and provide
      the following additional information in response to your questions:    Schedule
      B supporting Line 23 of your report discloses one or more contributions to a
      candidate for the 2008 Primary election; however the funds were disbursed after
      the election date:  The $5,000 contribution to Risch for Senate disbursed on
      7/24/2008 was incorrectly designated for the Primary election cycle due to clerical
      error.  I have amended the report and have attached the amended report designating
      this contribution to the General election.     Please clarify all expenditures
      made for Event Catering, Fundraising Consultant and Professional Fundraiser
      on Schedule B.  If a portion or all of these expenditures were made on behalf
      of specifically identified federal candidates, this amount should be disclosed
      on Schedule B or E:  These expenditures were not made for the election or defeat
      of any specific candidate.  Rather, these expenditures were made for events
      to raise funds for Heartland Values PAC.  Therefore, there is no need to amend
      the report to clarify expenditures made for Event Catering, Fundraising Consultant
      or Professional Fundraiser.    We trust this information answers your questions.
      \ If you have any further questions or need additional information, please do
      not hesitate to contact me at 605/376-3437.    Sincerely,    Barb Buell  Deputy
      Treasurer  Heartland Values PAC  PO Box 505  Sioux Falls, SD  57101-0505"
